import './Header.css';
import spaceXlogo from '../../../Assets/SpaceX-Logo-White.svg';

export default function Header() {
    return(
        <div className="navbar">
            <a href="/"><img src={spaceXlogo} alt="logo" ></img></a>
            <a href="/">Home</a>
            <a href="/">News</a>
            <a href="/">Contact</a>
        </div>
    )
}
